import "./style.css"

function BlackDivItem(props){
    return(
        <div className="blackDivItem">
            <div className="blackDivItem_icon">
            <i class></i>
            </div>
            <div className="blackDivItem_text">
                <p>{props.header}</p>
                <p>As a team specialized in the logistics sector, we have years of experience and knowledge. Having the necessary knowledge to understand your business and logistics needs enables us to offer you the best solutions.</p>
            </div>
        </div>
    )
}

export default BlackDivItem;
